import "./Header.scss";
import logoCRC from "../../assets/images/logocrc.png";

const Header = () => {
    return (
        <header className="header">
            <div className="row">
                <div className="col-md-10">
                    <a href="https://www.crcom.gov.co/es/pagina/inicio" Target="_blank">
                        <img 
                            className="img-crc" 
                            alt="logo de CRC" 
                            src={logoCRC}
                            data-toggle="tooltip" 
                            title="Logo CRC, aquÃ­ se puede dirigir a dicho sitio"   
                        />  
                    </a>
                </div>
            </div>
        </header>
    )
}

export default Header
